// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-gray-800 p-4">
      <ul className="flex space-x-4">
        <li>
          <Link to="/" className="text-white hover:text-gray-400">Home</Link>
        </li>
        <li>
          <Link to="/login" className="text-white hover:text-gray-400">Login</Link>
        </li>
        <li>
          <Link to="/register" className="text-white hover:text-gray-400">Register</Link>
        </li>
        <li>
          <Link to="/posts" className="text-white hover:text-gray-400">Posts</Link>
        </li>
        <li>
          <Link to="/gallery" className="text-white hover:text-gray-400">Gallery</Link>
        </li>
        <li>
          <Link to="/admin" className="text-white hover:text-gray-400">Admin</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
